	my $acode = &encd($hy);
	$enc .= '-' . $acode;
        return $enc;
}

sub delal {
	my $code = shift;
	my @a = split(//,$code);
	my %mapc = ( A=>0,B=>1,C=>2,D=>3,E=>4,F=>5,G=>6,H=>7,I=>8,J=>9,K=>10,L=>11,M=>12,N=>13,O=>14,P=>15,Q=>16,R=>17,S=>18,T=>19,U=>20,V=>21,W=>22,X=>23,Y=>24,Z=>25 );
my $one = pop @a;
my $two = pop @a;
my $three = pop @a;

my $el;
if (defined $one && defined $two && defined $three) {
$el = $mapc{$three}*676+$mapc{$two}*26+$mapc{$one};
} elsif (defined $one && defined $two ) {
$el = $mapc{$two}*26+$mapc{$one};
} elsif (defined $one) {
$el = $mapc{$one};
} else {
$el=0;
}
	return $el;
}

sub elal { 
        my $decll = shift;
        my $base = Math::BigInt->new(BASEAEL);
        my $j=0;
        my %rems;
        my %divs; 
        my $num = Math::BigInt->new($decll);
        my ($dig,$rem) = $num->bdiv($base);
        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
                last if $j>3;
        }
        $rems{$j} = $rem;
        $divs{$j} = $dig; 
        foreach (sort {$b <=> $a} keys %rems) {
                if (defined $enc) {
                        $enc .= ''.ALPHA->[$rems{$_}];
                } else {
                        $enc = ALPHA->[$rems{$_}];
                }
        }
        return $enc;
}


sub encd {
	my $decll = shift;
        my $base = Math::BigInt->new(BASEA);
        my $j=0;
        my %rems;
        my %divs;
        my $num = Math::BigInt->new($decll);
        my ($dig,$rem) = $num->bdiv($base);
        my $enc;
        while ($dig) {
                $rems{$j} = $rem;
                $divs{$j} = $dig;
                $j++;
                my $dec = Math::BigInt->new($decll);
                $dec->bsub($rem);
                $dec->bdiv($base);
                $decll = $dec;
                my $num2 = Math::BigInt->new($decll);
                ($dig,$rem) = $num2->bdiv($base);
		last if $j>10;
        }
	$rems{$j} = $rem;
	$divs{$j} = $dig;
	foreach (sort {$b <=> $a} keys %rems) {
		if (defined $enc) {
                        $enc .= ''.ALPHANUMERIC->[$rems{$_}];
		} else {
			$enc = ALPHANUMERIC->[$rems{$_}];
		}
	}
	return $enc;
}



