sub lltodec {
        my ($lat,$lon,$geoname,$el) = @_;
	$lat = sprintf( "%.5f", $lat );
	$lon = sprintf( "%.5f", $lon );
	$el = 0 unless defined $el;
	$el = int($el);
	my $flagel;
	if ($el<0) {
		$flagel = '-';
	} else {
		$flagel = '+';
	}
	$el = abs($el);
	my $elcode = elal($el);
	my $dele = delal($elcode);

	if ($lat<-90 || $lat>90 || $lon<-180 || $lon>180) {
		return 0;
	}

        $lat *= 100000;
        $lon *= 100000;
	my $x = Math::BigInt->new($lat); 
	my $y = Math::BigInt->new($lon);
        my $xx = Math::BigInt->new($lat);
        my $yy = Math::BigInt->new($lon);
	$x->badd($y); 
	my $xy = $x;
	$xx->bsub($yy); 
	my $yx = $xx;
        my $aa = Math::BigInt->new($xy);
        my $bb = Math::BigInt->new($yx);
	my $coef =  Math::BigInt->new('27000000'); 
	$aa->badd($coef);
	$bb->badd($coef);
	$xy = $aa;
	$yx = $bb;
	my $binlat = sprintf ("%b", $xy);
	my $binlon = sprintf ("%b", $yx);
	my @a = split(//,$binlat);
	my @b = split(//,$binlon);
	my $combinedll ='';
	while (@a || @b) {
		my $b1 = pop @a;
		my $b2 = pop @b;
                $b1 = '0' unless defined $b1;
                $b2 = '0' unless defined $b2;
		$combinedll = $b1.$b2.$combinedll;
	}
	my $bigbin = Math::BigInt->from_bin($combinedll);
        my $decimal = $bigbin->bstr();
	my $decismall = Math::BigInt->new($decimal);	

        my $deciminus = Math::BigInt->new(PADD); 
	$decismall->bsub($deciminus);   
	$decimal = $decismall;

	my $geocode; #will return either an alphanumeric geocode, or a triple name geocode here.
	if (defined $geoname) {
		if ($geoname == 2) {
			$geocode = &hybrid($decimal);
		} else {
			if ($geoname == 3) {
				$geocode = &nencdn($decimal);
			} else {
				$geocode = &nencd($decimal,$elcode,$flagel);
			}
		}
	} else {
		$geocode = &encd($decimal);
	}
	return $geocode;
}



=head1 NAME

Geo::Code::XYZ - Encode latitude,longitude,elevation into three names and vice versa.

=head1 VERSION

Version 1.5

=cut

our $VERSION = '1.5';


=head1 SYNOPSIS

	use Geo::Code::XYZ;
	my $g = Geo::Code::XYZ->new();
	my ($x,$y,$z) = (56.936650,24.088020,6);
	my $geocode = $g->geocode(lat=>$x,lon=>$y,el=>$z,geoname=>1);
	print $geocode . "\n";
		#RIGA-FRIDAY-OKEG
	
	my $xyz = $g->geocode(gc=>$geocode);
	my ($lat,$lon,$el) = @$xyz;
	print "The latitude,longitude,elevation of $geocode is $lat,$lon,$el\n";
		#56.936650,24.088020,6
		            
	
        # geoname: 0 => Alphanumeric, 1 => three geonames, 2 => hybrid string (one geoname and a string), 3 => numeric code.
                     


=head1 DESCRIPTION


Geo::Code::XYZ is the 3d version of the perl5 module Geo::Code. It produces location codes for latitude,longitude,elevation triplets with a resolution of 1 meter for an elevation of up/down to +- 17576 metres (in the three geoname version, geoname => 1, all other options default to elevation = 0). 

A set of 146300 geonames has been selected from geonames.org and other open sources with certain requirements such as: every geoname has phonetic/levenstein distance of at least 2 from every other geoname, major geonames are prioritized over less known ones to make the set more memorable.

The first geoname is the name of the most prominent location name in the vicinity of the point (for eg, L<LONDON-ZERO-MAX|https://3geonames.org/LONDON-ZERO-MAX> will be a location near London, UK.) The other two are random geonames or english words of length les than or equal to 9. If the first name is not a geoname, for eg, L<MAX-ZERO-LONDON|https://3geonames.org/MAX-ZERO-LONDON>, then the location is somewhere in the ocean or the poles, too far from any known geoname. (at least 200 kilometres away from the nearest geoname)

Geocodes that are close to each other will have similar names, for eg:  L<LONDON-SHURGARD-OINK|https://3geonames.org/LONDON-SHURGARD-OINK> and L<LONDON-SHURGARD-OPEC|https://3geonames.org/LONDON-SHURGARD-OPEC> are about 1 meter from each other, while L<LONDON-SHURGARD-OINK|https://3geonames.org/LONDON-SHURGARD-OINK> and L<LONDON-SHURIKEN-LAOLA|https://3geonames.org/LONDON-SHURIKEN-LAOLA> are about 383 meters away.

There are several improvements in Geo::Code::XYZ over the original Geo::Code, in addition to the elevation feature, such as, more intuitive name choices for readability and location proximity, more evenly spread phonetic distance for reducing errors in voice transmission of geocodes, picking geoname aliases according to OSM admin boundaries (3geonames.org online version only - this module does not rely on a database and this last feature needs one.)

This module is explained in more detailed on GitHub. L<View on GitHub|https://github.com/eruci/geocode>.

Online Demo. L<3Geonames.org|https://3geonames.org>.

Also supported on L<Geocode.xyz|https://geocode.xyz>.

